/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `dbrewsoft`.`tg_cuenta_cobrar`
BEFORE INSERT ON `dbrewsoft`.`c_ventas`
FOR EACH ROW
BEGIN
	DECLARE s INTEGER(11);

    IF NEW.co_forma_pago <> '1010' THEN
		INSERT INTO c_cuenta_cobrar (co_empresa, fe_venta, tipo_comprobante, nu_comprobante, co_cliente, va_neto, va_igv, va_venta, va_dscto, co_vendedor, co_forma_pago)
		VALUES (NEW.co_empresa, NEW.fe_venta, NEW.tipo_comprobante, NEW.nu_comprobante, NEW.co_cliente, NEW.va_neto, NEW.va_igv, NEW.va_venta, NEW.va_dscto, NEW.co_vendedor, NEW.co_forma_pago);
    END IF;

	IF NEW.fl_imprimir = 'S' THEN
		SET s = CONVERT(LEFT(NEW.nu_comprobante, 3), UNSIGNED INTEGER);
		INSERT INTO m_pool_printer VALUES(null, NEW.co_empresa, NEW.tipo_comprobante, NEW.nu_comprobante, s, 'N', 'N');
	END IF;
END */;;
