/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `dbrewsoft`.`tg_salida_productos`
BEFORE INSERT ON `dbrewsoft`.`d_ventas`
FOR EACH ROW
BEGIN
    DECLARE v_co_empresa CHAR(2);
    DECLARE v_co_usuario VARCHAR(45);
	DECLARE v_co_cliente VARCHAR(45);

	IF NEW.fl_pos = 'N' THEN

		SELECT co_empresa, co_vendedor, co_cliente INTO v_co_empresa, v_co_usuario, v_co_cliente
		FROM c_ventas
		WHERE tipo_comprobante = NEW.tipo_comprobante AND nu_comprobante = NEW.nu_comprobante;

		CALL procesar_kardex(
		v_co_empresa, NEW.tipo_comprobante, NEW.nu_comprobante,
		NEW.co_producto, NEW.ca_producto, NEW.va_producto,
		NEW.no_lote, NEW.fe_vencimiento, NEW.co_almacen, v_co_cliente, v_co_usuario, 'S');

	END IF;
END */;;
