				SET v_valor = ((v_va_stock_actual * v_ca_stock_actual) + (v_va_producto * v_ca_producto)) / (v_ca_producto + v_ca_stock_actual);
				INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, co_cliente, fe_creacion, co_almacen)
				VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '02', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, v_va_stock_actual, v_ca_producto, v_va_producto, v_ca_producto + v_ca_stock_actual, v_valor, v_co_cliente, NOW(), v_co_almacen);
			END IF;
		ELSEIF v_fl_tipo = 'S' THEN
			INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, co_cliente, fe_creacion, co_almacen)
			VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '05', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, 0, v_ca_producto, 0, v_ca_stock_actual - v_ca_producto, 0, v_co_cliente, NOW(), v_co_almacen);
		ELSEIF v_fl_tipo = 'IA' THEN
			SET v_ajuste = v_ca_producto - v_ca_stock_actual;
			INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, fe_creacion, co_almacen)
			VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '06', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, 0, v_ajuste, 0, v_ca_producto, 0, NOW(), v_co_almacen);
		ELSEIF v_fl_tipo = 'SA' THEN
			SET v_ajuste = v_ca_stock_actual - v_ca_producto;
			INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, fe_creacion, co_almacen)
			VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '07', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, 0, v_ajuste, 0, v_ca_producto, 0, NOW(), v_co_almacen);
		ELSEIF v_fl_tipo = 'IT' THEN
			INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, co_cliente, fe_creacion, co_almacen)
			VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '03', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, v_va_producto, v_ca_producto, v_va_producto, v_ca_producto + v_ca_stock_actual, v_va_producto, v_co_cliente, NOW(), v_co_almacen);
		ELSEIF v_fl_tipo = 'ST' THEN
			INSERT INTO r_kardex (co_empresa, co_producto, no_lote, fe_vencimiento, co_movimiento, tipo_comprobante, nu_comprobante, ca_stock_anterior, va_stock_anterior, ca_movimiento, va_movimiento, ca_stock_actual, va_stock_actual, co_cliente, fe_creacion, co_almacen)
			VALUES(v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, '04', v_tipo_comprobante, v_nu_comprobante, v_ca_stock_actual, 0, v_ca_producto, 0, v_ca_stock_actual - v_ca_producto, 0, v_co_cliente, NOW(), v_co_almacen);
		END IF;
	END IF;

	IF (v_tipo_comprobante = 'FV' OR v_tipo_comprobante = 'BV') AND v_fl_tipo = 'I' THEN
		SET v_va_compra_sin_igv = v_va_producto / 1.18;
		UPDATE m_productos SET va_compra_sin_igv = v_va_compra_sin_igv, va_compra = v_va_producto
		WHERE co_producto = v_co_producto;
	END IF;

	SELECT COUNT(*) INTO v_ca_stock_actual_count  
	FROM r_stock_producto 
	WHERE co_empresa = v_co_empresa AND co_producto = v_co_producto AND 
		  no_lote = v_no_lote AND co_almacen = v_co_almacen;

	IF v_ca_stock_actual_count  > 0 THEN
		IF v_fl_tipo = 'I' OR v_fl_tipo = 'IT' THEN
			UPDATE r_stock_producto SET 
			ca_stock = ca_stock + v_ca_producto, co_usuario = v_co_usuario
			WHERE co_empresa = v_co_empresa AND co_producto = v_co_producto AND 
			no_lote = v_no_lote AND co_almacen = v_co_almacen;
		ELSEIF v_fl_tipo = 'S' OR v_fl_tipo = 'ST' THEN
			UPDATE r_stock_producto SET 
			ca_stock = ca_stock - v_ca_producto, co_usuario = v_co_usuario
			WHERE co_empresa = v_co_empresa AND co_producto = v_co_producto AND 
			no_lote = v_no_lote AND co_almacen = v_co_almacen;
		ELSEIF v_fl_tipo = 'IA' OR v_fl_tipo = 'SA' THEN
			UPDATE r_stock_producto SET 
			ca_stock = v_ca_producto, co_usuario = v_co_usuario
			WHERE co_empresa = v_co_empresa AND co_producto = v_co_producto AND 
			no_lote = v_no_lote AND co_almacen = v_co_almacen;
		END IF;
	ELSE
		INSERT INTO r_stock_producto (co_empresa, co_producto, no_lote, fe_vencimiento, co_almacen, ca_stock, co_usuario)
		VALUES (v_co_empresa, v_co_producto, v_no_lote, v_fe_vencimiento, v_co_almacen, v_ca_producto, v_co_usuario);
	END IF;
END ;;
