CREATE DEFINER=`root`@`localhost` PROCEDURE `procesar_precios`()
BEGIN
	DECLARE codigo VARCHAR(7);
	DECLARE p1, p2, p3, p4, p5, p6, p7, p8 DOUBLE;
	DECLARE f1, f2, f3, f4, f5, f6, f7, f8 INT(11);
	DECLARE done INT DEFAULT 0;
	DECLARE cur_productos CURSOR FOR SELECT codigo_loc,
	precio1, factor1, precio2, factor2, precio3, factor3, precio4, factor4,
	precio5, factor5, precio6, factor6, precio7, factor7, precio8, factor8
	FROM dbmely02.articulos_mt;
	DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
	
	TRUNCATE r_productos_precios;

	OPEN cur_productos;

	REPEAT
    FETCH cur_productos INTO codigo, p1, f1, p2, f2, p3, f3, p4, f4, p5, f5, p6, f6, p7, f7, p8, f8;
		IF NOT done THEN
			INSERT INTO r_productos_precios VALUES
			(null, codigo, f1, p1),
			(null, codigo, f2, p2),
			(null, codigo, f3, p3),
			(null, codigo, f4, p4),
			(null, codigo, f5, p5),
			(null, codigo, f6, p6),
			(null, codigo, f7, p7),
			(null, codigo, f8, p8);
		END IF;
	UNTIL done END REPEAT;

	CLOSE cur_productos;

	DELETE FROM dbrewsoft.r_productos_precios WHERE va_per = 0;

END ;;
